  definition: ensemble en forme d’arbre de micro-vides remplis d’eau qui sont connectés
    par des cheminements oxides, qui peuvent se produire au niveau des accroissements
    de champ électrique soumis à une contrainte électrique et toujours en présence
    d’humidité
